import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';  // Notice the change here
import HomePage from './pages/HomePage';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>  {/* Changed Switch to Routes */}
          <Route path="/" element={<HomePage />} />  {/* Changed component to element */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
